import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';

export const SidebarData = [
  {
    title: 'Home',
    path: '/',
    icon: <AiIcons.AiFillHome />,
    cName: 'nav-text'
  },
  {
    title: 'Calendar',
    path: '/calendar',
    icon: <FAIcons.FaRegCalendarAlt />,
    cName: 'nav-text'
  },
  {
    title: 'Plant Search',
    path: '/search',
    icon: <FaIcons.FaCarrot />,
    cName: 'nav-text'
  },
];
